import "./App.css";
import MasonryImageList from "./components/Gallery";
import Moritzhagen8 from "./assets/Moritzhagen8.jpeg";
import BookingPanel from "./components/Booking";
import { KeyboardArrowDown } from "@mui/icons-material";

function App() {
	return (
		<div className="App">
			<BookingPanel></BookingPanel>
			<div className="regularMargins">
				<MasonryImageList></MasonryImageList>
			</div>
		</div>
	);
}

export default App;
